import React, { useState } from "react";
import { View, Text, StyleSheet, Image } from "react-native";

const Configuration = () => {
    const estadistica = "https://previews.123rf.com/images/jevee/jevee1606/jevee160600877/59172742-resumen-elaborado-por-fondo-colorido-fondo-de-pantalla-art%C3%ADstica-en-colores-verde-rosa-con-puntos.jpg";
    return (
        <View style={styles.container}>
           
            <View >

                <Text >
                    ESTADISTICAS
                </Text>
            </View>
        </View>
    )
}

const styles = StyleSheet.create({
    container: {
        width: "50%",
        alignItems: 'center'
    },
    
    estad: {
        alignItems: 'center',
        marginTop: -75
    },
})

export default Configuration;
